import numpy as np
from matplotlib import pyplot as plt
import tensorflow as tf
from io import BytesIO
from PIL import Image
import base64


### 将图片base64化为一个字符串


img_b = b''
inf = BytesIO(base64.b64decode(img_b))
img = Image.open(inf)
img = np.asarray(img, dtype=np.uint8)
plt.imshow(img)

### 这里图像像素值在0-255之间，神经网络里面，数据的值需要做一下归一化处理。
img = img/255
img = np.expand_dims(img, axis=0) # 将图像处理成为一个batch
print("图像的维度为：",img.shape)


# conv2d中padding有两种选项，当为"SAME"时有可能需要扩充输入数据的维度与数据
# 在这里img.shape为(1,350, 500, 3),为4个维度，比较抽象，我们先假设比较简单的扩充数据维度的问题

# a=np.zeros((2,2,2,3))
# print(a.shape)
# # 输出(2,2,2,3)要变成(2,3,3,3)，需要改变的维度是第二个，索引为1，使用np.append()填充0数据，扩充维度
# b=np.append(a,np.zeros((2,1,2,3)),axis=1)
# print(b.shape)
# # 输出(2,3,2,3)，第二个纬度从2变成了3，同样对需要改变的另一个纬度进行操作，需要注意的是此时第二个维度已经发生变化，应使用新维度
# c=np.append(b,np.zeros((2,3,1,3)),axis=2)
# print(c.shape)
# # 输出(2,3,3,3)



def conv2d(input, filter, stride, padding):
    # batch x height x width x channels
    in_s = input.shape
    # height x width x in_channels x out_channels
    f_s = filter.shape

    assert len(in_s) == 4, 'input size rank 4 required!'
    assert len(f_s) == 4, 'filter size rank 4 required!'
    assert f_s[2] == in_s[3], 'intput channels not match filter channels.'
    assert f_s[0] >= stride and f_s[1] >= stride, 'filter should not be less than stride!'
    assert padding in [
        'SAME', 'VALID'], 'padding value[{0}] not allowded!!'.format(padding)

    if padding != 'VALID':
        temp = input
        d = (np.array(in_s[1: 3])-np.array(f_s[:2]))%stride
        if d[0]!=0:
            temp = np.append(temp,np.zeros((in_s[0],d[0],in_s[2],in_s[3])),axis=1)
        if d[1]!=0:
            temp = np.append(temp,np.zeros((in_s[0],in_s+d[0],d[1],in_s[3])),axis=2)
        input = temp
        in_s = input.shape

    out_shape = (np.array(in_s[1: 3]) -
                 np.array(f_s[:2]))//stride + 1
    out_shape = np.concatenate([in_s[:1], out_shape, f_s[-1:]])
    output = np.zeros(out_shape)
    for i in range(out_shape[0]):
        # i 代表第几批数据，这个一定是放在第一位的
        for j in range(out_shape[1]):
            for k in range(out_shape[2]):
            # j,k 分别代表第i批生成数据中，第j行k列
                for l in range(out_shape[3]):
                    # l 代表第几个卷积核，接下来是卷积操作
                    conv_val=0
                    for m in range(f_s[0]):
                        # m,n,o 代表卷积核长、宽、图像深度
                        for n in range(f_s[1]):
                            for o in range(f_s[2]):
                                conv_val+=filter[m,n,o,l]*input[i,j*stride+m,k*stride+n,o]
                    output[i,j,k,l]=conv_val
    return output


filter = np.random.uniform(size=[5, 5, 3, 8])
padding = 'VALID'
stride = 3
output = conv2d(img, filter, stride, padding)
print("使用numpy实现的卷积操作计算出的结果维度：",output.shape)


### 怎么验证上面的卷积函数是正确的呢？用tensorflow里面已经实现好的卷积函数进行同样的计算，结果相同即可认为上面的实现是正确的。

### 定义tensorflow的计算图，因为我们这里只计算，不涉及其他的东西，所有的参数都是输入的，所以图里只有一个操作。



# 定义输入
input_tensor = tf.placeholder(
    tf.float32, shape=[None, 350, 500, 3], name='input')
filter_tensor = tf.placeholder(
    tf.float32, shape=[5, 5, 3, 8], name='filter')

# 执行卷积
output_tensor = tf.nn.conv2d(
    input_tensor, filter_tensor, padding=padding, strides=[1, stride, stride, 1])

# 这里执行运算图
with tf.Session() as sess:
    tf_output = sess.run(output_tensor, feed_dict={
                         input_tensor: img, filter_tensor: filter})
print("使用tensorflow的卷积操作计算出的结果维度：",tf_output.shape)


# ### 验证一下我们写的卷积函数是不是正确的，因为浮点型有精度的问题，所以比较的时候需要检查参差。


print("L1误差均值：",np.mean(np.abs(output - tf_output)))
print("L1误差最大值：",np.max(np.abs(output - tf_output)))
assert np.mean(np.abs(output - tf_output)) < 1e-5  # 如果这一行没有报错的话，那么实现可以认为是正确的。